{
  return iSCF::SCF;
}


PyObject *
_csRef_to_Python (const csRef<iBase> & ref, void * ptr, swig_type_info * name)
{
  if (!ref.IsValid())
  {
    Py_INCREF(Py_None);
    return Py_None;
  }
  ref->IncRef();
  return SWIG_NewPointerObj((void *)ptr, name, 1);
}


